mapper.select:
select 

,

from TFSLC1_TEMP
where AMEND_OTHER_SL = #{AMEND_OTHER_SL}
  and BRANCH = #{BRANCH}
  and COMP_CODE = #{COMP_CODE}
  and LC_NBR = #{LC_NBR}
  and LC_TYPE = #{LC_TYPE}
  and LC_YEAR = #{LC_YEAR}

mapper.delete:
delete from TFSLC1_TEMP
where AMEND_OTHER_SL = #{AMEND_OTHER_SL}
  and BRANCH = #{BRANCH}
  and COMP_CODE = #{COMP_CODE}
  and LC_NBR = #{LC_NBR}
  and LC_TYPE = #{LC_TYPE}
  and LC_YEAR = #{LC_YEAR}
